module.exports = "<aside id=\"law\" class=\"scrollto text-center\" data-enllax-ratio=\".2\">\n\n    <div class=\"row clearfix\">\n  \n        <div class=\"section-heading\">\n            <h3>lets explore</h3>\n            <h2 class=\"section-title\"> Engg Course details</h2>\n            <h1>Aeronautical and Astronautical Engineering</h1>\n           <p>Students interested in aeronautical and astronautical engineering need a mechanical, scientific and mathematical aptitude. The science of designing and testing new vehicles for spaceflight or general aviation is interdisciplinary. Read on to see academic and career options in this field.\n\n        </p>\n        <h3>Inside Aeronautical and Astronautical Engineering</h3>\n        <p>Aeronautical and aerospace engineers rely on an interdisciplinary mix of mechanical, electronics and materials engineering skills. In the field, they can focus on the design of aircraft or spacecraft. Some focus on the design of missiles, probes or other unmanned devices. Both aeronautical and astronautical engineers incorporate propulsion, control systems, aerodynamics and thermodynamic considerations into their designs. They're also responsible for testing aircraft, materials or flight systems.\n\n            Astronautical and aeronautical careers are in demand. There are plenty of online and on-campus degree options to get you started. The resources from Study.com may help you find the right educational and career path.</p>\n        </div>\n      <h2>Education Information</h2>\n        <p>Most employers look for graduates of a 4-year aerospace engineering program recognized by ABET. Undergraduate programs provide a basic education in electronics, principles of flight, physics, thermodynamics, propulsion and materials science. However, students can focus their studies in one or more of these areas.\n\n            Aeronautical and astronautical engineers need a graduate degree if they're looking for supervisory, research or teaching positions. A graduate degree might also be required to work on experimental designs. Most graduate programs will accept students with a background in mechanical, electronic, or computer engineering if they don't have an aerospace degree.\n            \n    <h3>ENGINEERING MECHANICS</h3>\n   \n<p>Engineering mechanics are often associated with mechanical engineers. Typically, they focus more on the scientific side of things, but many educational requirements remain the same. Read on to learn more about the field of engineering mechanics.</p>\n\n<h2>Inside Engineering Mechanics</h2>\n<p>Engineering mechanics are not necessarily mechanical engineers. Rather, they are engineering scientists who may go into careers in research, manufacturing or engineering.</p>\n\n<h2>Education Information</h2>\n<p>There are few engineering mechanic programs, and the titles and skills provided by these programs can vary widely. However, there are a number of other engineering programs that allow you to concentrate on the specialization that interests you. Most of these engineering programs award bachelor's degrees. Education provided by engineering mechanics degree programs focus on the mechanical, civil and architectural career fields.</p>\n\n<p>Typically, the first two years of study are comparable to those of mechanical engineering majors, and it is in the second two years that students begin to delve into subjects like dynamics, solid mechanics, electrical engineering and vibrations. In an undergraduate program, students can also expect to take courses such as computational mechanics, intermediate dynamics and engineering statistics. Some engineering mechanics students may go on to obtain graduate business degrees to advance to middle or executive management positions. These articles offer more information about degree programs you can pursue.</p>\n\n<p>Applied Engineering Degree Program Information</p>\n\n<p>Engineering Mechanics Program Information</p>\n<p>Engineering Mechanics Program Information</p>\n<p>Engineering Mechanics Program Information</p>\n<p>Engineering Mechanics Program Information</p>\n<h3>Metallurgical Engineering</h3>\n<p>Metallurgical engineering is the study of metals. Combining theory and practice, degree programs cover the mining, extraction, design and processing of metals, as well as how metals react to environmental changes or stress. Students also learn fundamental engineering principles.\n\n</p>\n<h3>Biological and agricultural engineering</h3>\n<p>Biological and agricultural engineering refers to the incorporation of engineering principles and theories into natural systems to improve food, water, energy, machines and the environment. Research relevant education and career options here.</p>\n<h3>Engineering physics</h3>\n<p>Students with a degree in engineering physics may find jobs in a number of industries as well as academia. Such jobs may include aerospace engineer, nuclear engineer and materials scientist, as well as acoustical engineer, medical physicist and optical engineer. According to the U.S. Bureau of Labor Statistics (BLS), most research positions in the field of physics require a doctoral degree (www.bls.gov). However, the majority of engineers enter the field with a bachelor's degree in engineering with a specific concentration. Additionally, many engineering jobs require licensing. Study.com has information about programs in both engineering and physics that will help you further explore possible education and career options.</p>\n<h3>Mining engineering</h3>\n<p>Mining engineering is a discipline that applies science, technology and mechanical principles to locate and extract mineral resources from the earth as safely, efficiently and non-destructively as possible. The recovery techniques used depend on whether a mine is a surface or an underground operation. Mining engineers may also play a role in converting exhausted mining sites into livable habitats. Aspiring mining engineers have several educational and professional routes at their disposal.\n\n</p>\n<h3>Biomedical and medical engineering</h3>\n<p>Biomedical engineering and medical engineering are two phrases for the same subject. These engineers develop mechanical and electrical solutions to medical problems, such as designing artificial organs. They also develop diagnostic and imaging equipment. The field is constantly evolving, but some specialties within it have become staples, including tissue and cellular engineering, biomechanics, biomedical imaging and biochemistry.</p>\n<h3>Naval Architecture and Marine engineering</h3>\n<p>Naval architecture and marine engineering is a specialized field of engineering offered at only about 14 schools in the United States. Graduates of such programs work in shipbuilding and design, marine safety, offshore drilling, technical consulting and marine systems engineering. Those entering this field should be creative and able to work in teams. If naval architecture and marine engineering appeals to you, take a look at the following Study.com resources. They'll provide information to help you make informed decisions about your educational and professional paths.\n\n</p>\n<h3>Ceramic sciences</h3>\n<p>Although many people relate ceramics to pottery, ceramic sciences, commonly known as ceramic engineering, is a complex discipline with multiple high-tech applications. Inorganic, non-metallic ceramic materials are processed at extremely high temperatures and transformed into a wide variety of products. Ceramics contribute to everyday life in a number of ways as components of items that include glass light bulbs, jet engines, computers, cars and household appliances.\n\n</p>\n<h3>chemical engineering</h3>\n<p>Chemical engineers are responsible for breaking down, analyzing and researching different chemical compounds. They can help create the materials used in food, textiles, industrial products or medicine. The field of chemical engineering offers a variety of opportunities to work on specialized, innovative projects. Chemical engineers must be highly skilled in calculus, chemistry, physics and biology.</p>\n<h3>Nuclear engineering</h3>\n<p>Nuclear engineers are responsible for ensuring that nuclear power plants run efficiently and safely. They help design new reactors and handle nuclear fuel. Some engineers also work with medical technologies as well as defense applications involving the use of nuclear materials.\n\n    The following resources from Study.com can help you further explore the field of nuclear engineering.</p>\n<h3>civil engineering</h3>\n<p>Civil engineers are responsible for planning and creating building projects, such as water systems, tunnels, bridges and other public works projects. During the design phases of a project, engineers calculate the load requirements and weather conditions that the completed structure needs to withstand. They then usually consult with the builders to ensure that the project is constructed safely and successfully.\n\n    The civil engineering field offers a variety of professional and educational opportunities. Study.com offers the latest information that can help you find the path that's right for you</p>\n<h3>Forest engineering</h3>\n<p>Forest engineering is the application of engineering principles and techniques to the management of forest lands. This includes working to ensure the health and sustainability of wildlands, timberlands and watersheds while allowing for such economic activities as timber harvesting and recreational use.</p>\n<h3>Geological engineering</h3>\n<p>The field of geological engineering is concerned with mineral and energy resources and exploration. Closely related to mining engineering, it involves the location and extraction of minerals from the earth and the identification of new sources of energy, like geothermal energy, for industrial use. Geological engineers also inspect geological conditions in areas of resource exploration for safety and feasibility.\n\n    The work of geological engineers often includes protecting the environment through proper waste disposal, water maintenance, erosion control and properly designed tunnels, dams and caverns. Some geological engineers mitigate the impacts of geologic hazards like landslides, volcanoes and earthquakes. Geological engineers must enjoy working outdoors in remote locations. Their work may entail traveling overseas to advise companies on site-specific methods for resource exploration.\n    \n    </p>\n<h3>Ocean engineering</h3>\n<p>Ocean engineers study the effects of the ocean on ships, vehicles and other structures. They design dams, levees, canals and complex tide abatement systems. Essentially, ocean engineering is the marine-based branch of civil engineering. It merges classical courses in civil and mechanical engineering with oceanography and naval architecture. Learn more about ocean engineering by exploring some of the Study.com articles linked below.\n\n</p>\n<h3>Industrial engineering</h3>\n<p>Industrial engineers explore ways to manufacture products or complete tasks in a quicker, more convenient manner. Professionals in this field rely on their knowledge of business organization, product requirements and safety methods to maximize output. Industrial engineers may also work to improve product delivery through better management methods and quality control.\n\n    You can typically apply for industrial engineering positions with a bachelor's degree, but there are a wide variety of other programs that can prepare you for related job roles. You might want to consider becoming an in-house engineer or a consultant, for instance. Study.com can provide you with the resources to learn more about this field's education and career possibilities.\n    \n    </p>\n<h3>Petroleum Engineering</h3>\n<p>Petroleum engineers assess the cost, impact and potential of drilling operations to extract oil, gas and other natural resources from underground. They design new methods for extracting these resources that also address safety, environmental and economic concerns. Petroleum engineers also look for ways to improve production through advanced techniques and technology. They must be able to work effectively with other engineers in the installation of drilling equipment, the interpretation of test drills and the creation of computer simulations that can help identify construction and production issues.\n\n    Study.com offers you information and resources needed to learn about educational and career opportunities in petroleum engineering. These including finding the right degree program for you, determining a career field and pursuing advanced or continuing education.</p>\n<h3>Plastics engineering</h3>\n<p>Materials engineers may choose to specialize in plastics. The field of plastics engineering involves the application of scientific and engineering principles to the development of a wide variety of polymer products. From airplane wings to golf clubs and a host of goods in between, a plastics engineer solves material-related problems with the goal of designing and developing products with improved performance and durability. Plastics engineers may find careers in government, academia and the manufacturing industry. Typical job titles may include materials research engineer, production planner, process engineer or plastic product designer.</p>\n<h3>Surveying</h3>\n<p>Surveyors determine official land, water, and air boundaries and mark important reference points for use in architecture, construction, mapping and litigation. They take detailed measurements and map the contours and boundaries of a designated area on the Earth's surface, either underground or underwater. Through these measurements, they can establish property and political boundaries, help contractors and architects plan their buildings, create maps and gather digital information for GIS. Surveyors blend knowledge and expertise from cartography, geography, engineering and surveying to perform these duties.\n\n</p>\n<h3>Computer engineering</h3>\n<p>Computer engineers create and maintain computer systems and may specialize in one aspect of computer engineering, such as hardware or software engineering. Hardware engineers design computer circuitry, disks, chips, printers and other computer devices, while computer software engineers develop computer applications and programs. Good math and analytical skills are necessary for students interested in a career in computer engineering.</p>\n<h3>Manufacturing engineering</h3>\n<p>Manufacturing engineers design, direct and coordinate the manufacturing process of products at every level. From the beginning planning process of a product to finalizing and packing the completed goods, a manufacturing engineer is involved in the process. Ultimately, manufacturing engineers create and implement processes to manufacture products in a low-cost, but efficient, way. Manufacturing engineering professionals are known to apply scientific, mathematics and engineering principles during production to meet several demands. Some of the demands that manufacturing engineers must meet include increasing production turnaround times and improving the flow of production.</p>\n<h3>Systems Engineering</h3>\n<p>Systems engineering refers to the development of reliable and effective systems. Essentially, it is a combination of components or elements that work together to efficiently generate outcomes that couldn't be attained by any one component. Utilizing interdisciplinary approaches and methods, the principles of systems engineering can be applied to problem-solving tasks in many industries.</p>\n<h3>Textile engineering</h3>\n<p>Textile technology programs teach the science of creating and enhancing fibers, fabrics and other textiles used in manufacturing, apparel, healthcare and consumer products. Training in textile technology prepares students for a number of different career paths, such as textile engineer, interior designer, materials scientist and researcher. If any of these occupations interest you, check out the article links from Study.com listed below.\n\n</p>\n<h3>Drafting and designing engineering</h3>\n<p>Creators of blueprints and drawings, drafters and design engineers work for manufacturing plants, construction agencies, design firms or engineering companies. Drafting and design engineers in construction fields might use an architect's rough drawings to create clear and representational diagrams, ensuring that buildings are made to exact specifications. Drafters and designers can also work in various facets of business and manufacturing from aerospace to home appliances.\n\n</p>\n<h3>Materials Engineering</h3>\n<p>Materials engineers study specific substances at the atomic level using computers to replicate characteristics of those substances. Understanding material composition at the most basic level and the synthesis of new materials are of primary importance to material engineers, who select, design, develop, manufacture, test and evaluate materials that meet the specifications of various projects and products. Materials engineering experts often find career opportunities with the government, as well as in the computer, electronics, transportation, metal fabrication and machinery manufacturing industries.</p>\n<h3>Electriacl engineering and electronics</h3>\n<p>Electrical engineering is concerned more with power generation, storage and transmission. Electronics engineering is focused on appliances and devices that use electricity, as well as electricity applications that are used in signal processing or control systems. Those working in electrical and electronics engineering need inquiring and analytical minds along with creativity. Being detailed oriented and skilled in math and computers is also valuable. To discover more about this field's career options and academic requirements, take a look at the following Study.com resources.\n\n</p>\n<h3>Mechanical engineering</h3>\n<p>Mechanical engineering is a broad area of engineering. Mechanical engineers can work in design, development and research of machinery and mechanical systems and equipment. They may create power-producing and power-using machinery, including gas turbines, industrial equipment for manufacturing and electric generators.</p>\n<h3>Engineering- architectural</h3>\n<p>Architectural engineers use their expertise in design, physics, math, engineering and construction to help bring architects' designs to life. They develop structural systems for buildings, such as lighting, heating/AC and plumbing, that are functional, aesthetic and in accordance with building codes. Training is typically through 5-year undergraduate degree programs; graduates also have the option to become licensed as a professional engineer. Those entering the architectural engineering field should encounter good job prospects in this growing profession.</p>\n\n    </div>\n\n\n  </aside>"

