module.exports = "<aside id=\"law\" class=\"scrollto text-center\" data-enllax-ratio=\".2\">\n\n    <div class=\"row clearfix\">\n  \n        <div class=\"section-heading\">\n            <h3>lets explore</h3>\n            <h2 class=\"section-title\"> law Course details</h2>\n        </div>\n        <p>Law is a system of rules that are created and enforced through social or governmental institutions to regulate behavior.[2] Law is a system that regulates and ensures that individuals or a community adhere to the will of the state. State-enforced laws can be made by a collective legislature or by a single legislator, resulting in statutes, by the executive through decrees and regulations, or established by judges through precedent, normally in common law jurisdictions. Private individuals can create legally binding contracts, including arbitration agreements that may elect to accept alternative arbitration to the normal court process. The formation of laws themselves may be influenced by a constitution, written or tacit, and the rights encoded therein. The law shapes politics, economics, history and society in various ways and serves as a mediator of relations between people.</p>\n      \n       <h3>Legal subjects</h3>\n       <p>All legal systems deal with the same basic issues, but jurisdictions categorise and identify its legal subjects in different ways. A common distinction is that between \"public law\" (a term related closely to the state, and including constitutional, administrative and criminal law), and \"private law\" (which covers contract, tort and property).[136] In civil law systems, contract and tort fall under a general law of obligations, while trusts law is dealt with under statutory regimes or international conventions. International, constitutional and administrative law, criminal law, contract, tort, property law and trusts are regarded as the \"traditional core subjects\",[137] although there are many further disciplines.\n\n    </p>\n    <h3>International law</h3>\n      <p>International law can refer to three things: public international law, private international law or conflict of laws and the law of supranational organisations.</p> \n    <h3>Constitutional and administrative law</h3>\n       <p> Main articles: Constitutional law and Administrative law\n        \n        The French Declaration of the Rights of Man and of the Citizen\n        Constitutional and administrative law govern the affairs of the state. Constitutional law concerns both the relationships between the executive, legislature and judiciary and the human rights or civil liberties of individuals against the state. Most jurisdictions, like the United States and France, have a single codified constitution with a bill of rights. A few, like the United Kingdom, have no such document. A \"constitution\" is simply those laws which constitute the body politic, from statute, case law and convention. A case named Entick v Carrington[145] illustrates a constitutional principle deriving from the common law. Mr Entick's house was searched and ransacked by Sheriff Carrington. When Mr Entick complained in court, Sheriff Carrington argued that a warrant from a Government minister, the Earl of Halifax, was valid authority. However, there was no written statutory provision or court authority.</p>\n        <h3>Criminal law</h3>\n        <p>Criminal law, also known as penal law, pertains to crimes and punishment.[150] It thus regulates the definition of and penalties for offences found to have a sufficiently deleterious social impact but, in itself, makes no moral judgment on an offender nor imposes restrictions on society that physically prevent people from committing a crime in the first place.[151] Investigating, apprehending, charging, and trying suspected offenders is regulated by the law of criminal procedure.[152] The paradigm case of a crime lies in the proof, beyond reasonable doubt, that a person is guilty of two things. First, the accused must commit an act which is deemed by society to be criminal, or actus reus (guilty act).[153] Second, the accused must have the requisite malicious intent to do a criminal act, or mens rea (guilty mind). However, for so called \"strict liability\" crimes, an actus reus is enough.[154] Criminal systems of the civil law tradition distinguish between intention in the broad sense (dolus directus and dolus eventualis), and negligence. Negligence does not carry criminal responsibility unless a particular crime provides for its punishment.[155][156</p>\n<h3>Contract Law</h3>\n<p>Contract law concerns enforceable promises, and can be summed up in the Latin phrase pacta sunt servanda (agreements must be kept).[160] In common law jurisdictions, three key elements to the creation of a contract are necessary: offer and acceptance, consideration and the intention to create legal relations. In Carlill v Carbolic Smoke Ball Company a medical firm advertised that its new wonder drug, the smokeball, would cure people's flu, and if it did not, the buyers would get 100. Many people sued for their 100 when the drug did not work. Fearing bankruptcy, Carbolic argued the advert was not to be taken as a serious, legally binding offer. It was an invitation to treat, mere puffery, a gimmick. But the Court of Appeal held that to a reasonable man Carbolic had made a serious offer, accentuated by their reassuring statement, \"1000 is deposited\". Equally, people had given good consideration for the offer by going to the \"distinct inconvenience\" of using a faulty product. \"Read the advertisement how you will, and twist it about as you will\", said Lord Justice Lindley, \"here is a distinct promise expressed in language which is perfectly unmistakable\".[161]</p>\n<h3>Tort law</h3>\n<p>Torts, sometimes called delicts, are civil wrongs. To have acted tortiously, one must have breached a duty to another person, or infringed some pre-existing legal right. A simple example might be accidentally hitting someone with a cricket ball.[166] Under the law of negligence, the most common form of tort, the injured party could potentially claim compensation for their injuries from the party responsible. The principles of negligence are illustrated by Donoghue v Stevenson.[167] A friend of Mrs Donoghue ordered an opaque bottle of ginger beer (intended for the consumption of Mrs Donoghue) in a caf in Paisley. Having consumed half of it, Mrs Donoghue poured the remainder into a tumbler. The decomposing remains of a snail floated out. She claimed to have suffered from shock, fell ill with gastroenteritis and sued the manufacturer for carelessly allowing the drink to be contaminated. The House of Lords decided that the manufacturer was liable for Mrs Donoghue's illness.</p>\n<h3>Property law</h3>\n<p>Property law governs ownership and possession. Real property, sometimes called 'real estate', refers to ownership of land and things attached to it.[173] Personal property, refers to everything else; movable objects, such as computers, cars, jewelry or intangible rights, such as stocks and shares. A right in rem is a right to a specific piece of property, contrasting to a right in personam which allows compensation for a loss, but not a particular thing back. Land law forms the basis for most kinds of property law, and is the most complex. It concerns mortgages, rental agreements, licences, covenants, easements and the statutory systems for land registration. Regulations on the use of personal property fall under intellectual property, company law, trusts and commercial law. An example of a basic case of most property law is Armory v Delamirie [1722].[174] A chimney sweep's boy found a jewel encrusted with precious stones. He took it to a goldsmith to have it valued. The goldsmith's apprentice looked at it, sneakily removed the stones, told the boy it was worth three halfpence and that he would buy it. The boy said he would prefer the jewel back, so the apprentice gave it to him, but without the stones. The boy sued the goldsmith for his apprentice's attempt to cheat him. Lord Chief Justice Pratt ruled that even though the boy could not be said to own the jewel, he should be considered the rightful keeper (\"finders keepers\") until the original owner is found. In fact the apprentice and the boy both had a right of possession in the jewel (a technical concept, meaning evidence that something could belong to someone), but the boy's possessory interest was considered better, because it could be shown to be first in time</p>\n\n\n\n\n\n\n\n\n\n    </div>\n\n  </aside>"

