module.exports = "<aside id=\"mba\" class=\"scrollto text-center\" data-enllax-ratio=\".2\">\n\n    <div class=\"row clearfix\">\n  \n        <div class=\"section-heading\">\n            <h3>lets explore</h3>\n            <h2 class=\"section-title\"> M.B.A Course details</h2>\n        </div>\n      <h3>WHAT IS MBA?</h3>\n       \n  <p>There are many confusing questions that the ever-popular 3-letter acronym (M.B.A.) generates every year, as new higher education aspirants (enamoured by the exciting opportunities that the qualification seems to promise), hit the internet for answers.\n    \n    Whats an MBA?, How many years to complete an MBA? What is the average course duration?, What subjects does the course list cover?, What is the typical MBA course fee? and of course, Is it right for me?\n    \n    Its best that we start with the basics, right? If some of this sounds too trivial, feel free to jump to the section that you find the most relevant. Weve covered all the details about the MBA on this site, from the very simple to the highly advanced MBA topics.\n    \n    After youve completed reading up on the basic information about the MBA course on this page, dont miss the article at the bottom that explains how you can get into the best MBA colleges in the world (USA, UK, Canada, and India).\n    \n    While most of the information on this page (e.g. course list, types) is relevant for any MBA in India and abroad, the final article focuses on international GMAT MBA degrees. If you are seriously considering international business schools, dont forget to read Beyond The MBA Hype.</p>\n    \n<h3>Types of MBA courses</h3>\n<p>MBA courses can come in a wide variety of formats. The most common types of MBA courses are as follows: Full-time MBA, Executive MBA, Part time MBA, Correspondence Course, Distance MBA Courses, Online MBA coursesPhew! Quite a mind-boggling choice.\n\n    Each one has its pros and cons. Though there is no single best format, the full-time MBA format can get you the biggest bang for your buck.\n    \n    The average duration of full-time MBA programs can range between 1 to 2 years. Youll find programs like INSEAD that are shorter than 1 year. The duration of part-time programs can extend up to 3 years, since students are working and studying at the same time.\n    \n    Read this post to understand the different types of MBA courses.\n    \n    There are no clear answers to which one would be best for everyone. Heres a candidate who explains how he tackled the online eMBA course vs full-time MBA dilemma.</p>\n<h3>MBA course fees</h3>\n<p>While the MBA fees of many low ranking programs (that often struggle to get students enrolled) might be very low, the fees can really shoot up for the elite management programs.\n\n    And its not just the course fees that you need to consider. There are other costs too like the visa fees, books, laptop, flight costs, study trip expenses and the biggest (hidden) one that most MBA students overlook  the opportunity cost.\n    \n    Read this article to get an idea of the MBA Cost in India, USA and across the world.\n    \n    Not sure whether you should go for a traditional MBA (e.g. PGP from IIM) in India or a foreign MBA? Read the views of an Indian student who attended the best MBA courses in India and abroad: IIM MBA in India vs MBA abroad: Which is better?\n    \n    Our view is that it doesnt make much practical sense to go for a business degree when you havent spent enough time in a real job understanding how the corporate world works.\n    \n    Since good MBA courses are expensive, many students fund their MBA courses using education loans. However, a few smart students who manage the application strategy well get a significant amount of financial aid. Read how these students got partial and full MBA scholarships from really good MBA universities.</p>\n<h3>MBA course details</h3>\n<p>In the initial period, the course syllabus covers the following core subjects:\n\n    Accounting, Economics, Corporate finance, Strategy/Frameworks, Human Resource Management, Organisational Behaviour, Leadership, Marketing, Information Technology\n    \n    Once the basic foundation has been laid, youll have the option of specialising in any area that you want. This can be done by choosing several electives.\n    \n    Get up to speed by learning some important concepts covered in the MBA program. Read this article on MBA syllabus. It has a wealth of knowledge and free lessons covering the most basic and common subjects taught in the top MBA schools in USA, UK, Canada. Youll also get an idea of whether you really enjoy this field or its only the glamour of money thats attracting you to an MBA.\n    \n    Heres a list of MBA Specializations you can select from.</p>\n\n\n\n\n    </div>\n\n  </aside>"

